import Home from '~/pages/Home';
import Following from '~/pages/Following';
import Profile from '~/pages/Profile';
 
const publicRoutes = [
    {path: '/', compoment: Home},
    {path: '/followwing', compoment: Following},
    {path: '/profile', compoment: Profile},
];

const privateRoutes = [];

export {publicRoutes, privateRoutes };
